descricao:
i. Este módulo contempla ações pontuais de manutenção evolutiva da estrutura digital existente, como:
Atualização de banners promocionais ou imagens internas;
Ajustes visuais simples (alinhamento, espaçamento, responsividade);
Criação de cupons promocionais ou fretes personalizados;
Pequenas reorganizações de conteúdo ou seções já existentes;
Configuração de apps ou plugins nativos (dentro das limitações da plataforma);
Alterações de copy simples em páginas institucionais ou de produto;
Apoio consultivo sobre usabilidade ou sugestões de pequenas melhorias.
Suporte via canal oficial para esclarecimento de dúvidas operacionais.
Correções de falhas técnicas ou instabilidades identificadas;
Atualização de plugins, apps ou extensões nativas (quando houver);

ii. Estão incluídas até 6 (seis) horas mensais de execução, utilizadas conforme demanda da CONTRATANTE e validada pela equipe da CONTRATADA. As horas não são cumulativas entre ciclos.
iii. Demandas que envolvam novas páginas, reformulação de layout, integrações externas customizadas, funcionalidades avançadas ou alterações estruturais profundas deverão ser avaliadas e orçadas à parte, mesmo havendo saldo de horas.
iv. O suporte contempla atendimento para esclarecimento de dúvidas técnicas, sugestões de melhoria e execução de demandas básicas, conforme escopo e disponibilidade da equipe.
v. O prazo de resposta para novas solicitações será de até 48 horas úteis, com tempo de execução variável conforme complexidade da demanda.
vi. As horas mensais poderão ser divididas em múltiplas demandas, desde que estejam dentro do escopo do módulo e da capacidade técnica disponível. Um relatório mensal de consumo poderá ser fornecido mediante solicitação.
vii. A CONTRATANTE poderá contratar horas adicionais com 30% de desconto sobre o valor padrão da hora técnica, respeitando a disponibilidade da equipe da CONTRATADA.
viii. Este módulo será operado de forma mensal e recorrente, com foco em manter o ambiente digital funcional, atualizado e alinhado com as necessidades do negócio — sem contemplar evoluções estruturais ou reformulações visuais amplas.

i. Este módulo contempla ações de evolução contínua da presença digital, podendo incluir, mas não se limitando a:
Criação de banners promocionais e visuais internos;
Reorganização de seções ou blocos de conteúdo em páginas existentes;
Criação de novas seções ou blocos, desde que dentro da estrutura atual do layout;
Ajustes visuais em desktop e mobile para alinhamento, espaçamento, proporções e responsividade;
Criação de cupons promocionais, fretes personalizados ou ativações de campanhas;
Alteração e organização de categorias de produtos ou menus;
Implementação e configuração de aplicativos e extensões nativas da plataforma, como Shopify, WordPress, etc.;
Ajustes em formulários de contato, captação ou integração com CRM/plataformas de automação;
Ajustes simples de copy ou texto institucional;
Análises básicas com sugestões de melhorias visuais ou de usabilidade (UI/UX);
Outras melhorias ou pequenas manutenções previamente avaliadas como viáveis tecnicamente pela CONTRATADA;

ii. Estão incluídas até 12 (doze) horas mensais de execução, que poderão ser utilizadas conforme estratégia da CONTRATANTE. O uso é controlado e não cumulativo entre ciclos.
iii. Alterações significativas que envolvam desenvolvimento de páginas completas, reformulações de layout, integrações com sistemas externos sem conectores prontos ou demandas com complexidade elevada deverão ser orçadas à parte, mesmo que exista tempo disponível dentro do ciclo.
iv. O suporte técnico inclui atendimento consultivo, direcionamento estratégico, indicações de boas práticas e execução direta, conforme tempo disponível e viabilidade técnica.
v. As solicitações devem ser encaminhadas via canais oficiais. A equipe da CONTRATADA fará triagem técnica e priorização conforme alinhamento prévio e fila vigente.
vi. O prazo de resposta para novas demandas será de até 48 horas úteis. O tempo de resolução dependerá da complexidade da solicitação e da fila técnica.
vii. As horas técnicas contratadas poderão ser distribuídas entre múltiplas solicitações da CONTRATANTE, desde que estejam dentro do escopo acordado e sejam previamente aprovadas. Um relatório mensal de consumo poderá ser disponibilizado mediante solicitação.
viii. Caso a CONTRATANTE deseje contratar horas técnicas adicionais além do limite mensal previsto, essas horas poderão ser adquiridas com 40% de desconto sobre o valor padrão da hora avulsa praticado pela CONTRATADA, respeitando disponibilidade operacional.
ix. Este módulo será operado de forma recorrente e contínua, com foco em melhorias progressivas, estabilidade técnica, manutenção da competitividade digital e evolução funcional da plataforma contratada.

i. O escopo contempla a implementação completa do CRM, incluindo estruturação de funis, cadastros personalizados, usuários, pipelines e automações básicas e avançadas, em plataformas como Funnel, Kommo ou equivalentes.
ii. Serão desenvolvidas automações comerciais e de acompanhamento de leads, com base nos processos da CONTRATANTE, visando maior produtividade da equipe de vendas e previsibilidade nos fluxos de conversão.
iii. Estão inclusos:
Estruturação do funil de vendas com etapas e regras personalizadas;
Integração com ferramentas nativamente conectadas (ex: RD Station, Mailchimp, Active Campaign etc.);
Criação de fluxos de nutrição automatizados dentro do próprio CRM ou via integração;
Criação de dashboards com indicadores comerciais e relatórios de desempenho;
Treinamento da equipe comercial para uso adequado da ferramenta implementada;
Suporte técnico e estratégico durante a implantação.

iv. A CONTRATANTE será responsável pela contratação e pagamento direto da plataforma indicada, devendo garantir plano compatível com as funcionalidades previstas neste escopo.
v. As automações de e-mail e nutrição serão desenvolvidas exclusivamente por meio de integrações nativas entre o CRM adotado e as ferramentas externas. Integrações via API customizada não estão contempladas neste módulo.
vi. A CONTRATANTE deverá fornecer, de forma tempestiva, os insumos necessários para configuração da solução, incluindo: dados de produtos ou serviços, lista de contatos, segmentações desejadas, tom de voz, etapas do processo comercial e regras de qualificação.
vii. O não envio das informações ou a inatividade por parte da CONTRATANTE poderá impactar nos prazos ou limitar a profundidade da entrega, sem que isso gere compensações, penalidades ou obrigação adicional por parte da CONTRATADA.
viii. As datas e entregas serão pactuadas entre as partes, conforme capacidade produtiva da equipe da CONTRATADA e cronograma aprovado.

i. Este módulo contempla a designação de um Account Manager responsável por acompanhar o desempenho geral do projeto, realizar cobranças de tarefas, propor caminhos estratégicos e apoiar a CONTRATANTE em decisões táticas relacionadas ao marketing e operação digital.

ii. Estão incluídas neste módulo:

Reuniões semanais de acompanhamento, com duração média de até 1h;

Produção de ata e plano de ação após cada reunião;

Monitoramento verbal e suporte por canal de comunicação oficial (como WhatsApp ou e-mail);

Apoio na priorização de demandas e repasse para as equipes de execução;

Acompanhamento de métricas-chave e status das entregas dos módulos contratados.

iii. O Account Manager não é responsável pela execução técnica das demandas, mas pela coordenação, comunicação e acompanhamento de resultados junto às equipes especializadas.

iv. O escopo inclui o suporte estratégico e verbal, sem produção de relatórios analíticos ou dashboards específicos — salvo quando já contratados em módulos próprios.

v. O atendimento será realizado durante o horário comercial, com tempo médio de resposta de até 48h úteis.
